import styles from "./Teampage.module.css";
import React, {useEffect, useState} from "react";
import Footer from "../../components/_Layout/Footer";
import HeaderImg from "../../image/nail.png";
import {useNavigate} from "react-router-dom";

export default function Teampage() {
    const [rootTeam, setRootTeam] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetch("/api/my")
            .then(res => res.json())
            .then(res => {
                setRootTeam(res.rootTeam.sponsor)
            })
            .catch((err) => {
                console.error("API fetch error:", err); // 에러 처리
            });
    }, []);

    useEffect(() => {
        fetch("/api/watching")
            .then(res=>res.json())
            .then(res=> {
                setRecord(res);
            })
            .catch((err) => {
                console.error("API fetch error:", err); // 에러 처리
            });
    }, []);


    return (
        <div className={styles.default}>
            <div className={styles.cropping}>{rootTeam}
                <img className={styles.headerImg} src={HeaderImg} alt="Header" />
            </div>
            <div className={styles.inner}>
                <div className={styles.title}>2024 KBO</div>
                <br/>다가오는 경기 - 추후 기능 추가<br/><br/>


            </div>
            <Footer />
        </div>
    );
}
